import React from 'react';

const Achievements: React.FC = () => (
    <section
        id="achievements"
        style={{
            background: "#fff",
            borderRadius: "16px",
            boxShadow: "0 4px 16px rgba(0,0,0,0.08)",
            padding: "32px",
            margin: "32px auto",
            maxWidth: "700px",
            boxSizing: "border-box"
        }}
    >
        <h2
            style={{
                fontSize: "2.2rem",
                color: "#1a237e",
                marginBottom: "24px",
                textAlign: "center",
                fontWeight: 700
            }}
        >
            Achievements
        </h2>
        <ul style={{ padding: 0, margin: 0, listStyle: "none" }}>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <span style={{ fontWeight: 600, color: "#333" }}>
                    Solved over 800+ DSA problems on LeetCode with a peak rating of 1734
                </span>
                &nbsp;
                <a href="https://leetcode.com/u/Mohith_N__Raj/" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>
                    [LeetCode]
                </a>
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <span style={{ fontWeight: 600, color: "#333" }}>
                    Completed an 8-week Advanced DSA Live Program by GeeksForGeeks
                </span>
                &nbsp;
                <a href="https://media.geeksforgeeks.org/courses/certificates/a882e35cf6bdeccd54b61390f2b94daa.pdf" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>
                    [GeeksForGeeks]
                </a>
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "16px",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <span style={{ fontWeight: 600, color: "#333" }}>
                    Earned Gold badge in Java and Silver badge in Python on HackerRank
                </span>
                &nbsp;
                <a href="https://www.hackerrank.com/profile/appurajshekar201" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>
                    [HackerRank]
                </a>
            </li>
            <li style={{
                background: "#e3f2fd",
                borderRadius: "10px",
                padding: "16px",
                marginBottom: "0",
                fontSize: "1.1rem",
                boxShadow: "0 2px 8px rgba(0,0,0,0.04)"
            }}>
                <span style={{ fontWeight: 600, color: "#333" }}>
                    Cleared Java (Basic) skill certification on HackerRank
                </span>
                &nbsp;
                <a href="https://www.hackerrank.com/certificates/iframe/1a1ca34e34a7" target="_blank" rel="noopener noreferrer" style={{ color: "#1976d2", textDecoration: "underline" }}>
                    [Certificate]
                </a>
            </li>
        </ul>
        {/* Responsive styling */}
        <style>
            {`
                @media (max-width: 600px) {
                    section#achievements {
                        padding: 16px !important;
                        margin: 16px auto !important;
                    }
                    section#achievements h2 {
                        font-size: 1.4rem !important;
                    }
                    section#achievements ul li {
                        font-size: 1rem !important;
                        padding: 10px !important;
                    }
                }
            `}
        </style>
    </section>
);

export default Achievements;
